PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE percona_server_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  cnf_file varchar(100), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  rocksdb_packages varchar(1000), 
  tests_packages varchar(1000), 
  mysql_shell_packages varchar(1000), mysql_router_packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE percona_xtradb_cluster_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  cnf_file varchar(100), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  tests_packages varchar(1000), 
  garbd_packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE mysql_server_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  cnf_file varchar(100), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  tests_packages varchar(1000), 
  mysql_shell_packages varchar(1000), mysql_router_packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE percona_server_mongodb_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  conf_file varchar(100), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE percona_postgresql_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE postgresql_version(
  version varchar(20), 
  os varchar(20), 
  arch varchar(20),
  repo_url varchar(1000), 
  repo_file varchar(1000), 
  repo_enable_str varchar(20), 
  systemd_service varchar(20), 
  packages varchar(1000), 
  debug_packages varchar(1000), 
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE tests(
  test_id int,
  test_name varchar(100),
  cmd varchar(1000),
  constraint pk PRIMARY KEY(test_id)
);
CREATE TABLE test_cases(
  test_id int,
  cmd varchar(1000)
);
CREATE TABLE mariadb_version(
  version varchar(20),
  os varchar(20),
  arch varchar(20),
  repo_url varchar(1000),
  repo_file varchar(1000),
  repo_enable_str varchar(20),
  systemd_service varchar(20),
  cnf_file varchar(100),
  packages varchar(1000),
  debug_packages varchar(1000),
  rocksdb_packages varchar(1000),
  tests_packages varchar(1000),
  mysql_shell_packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE k8s_operators_version(name varchar(100), version varchar(20), constraint pk PRIMARY KEY(name, version));
CREATE TABLE percona_xtrabackup_version(
  version varchar(20),
  os varchar(20),
  arch varchar(20),
  repo_url varchar(1000),
  repo_file varchar(1000),
  repo_enable_str varchar(20),
  packages varchar(1000),
  debug_packages varchar(1000),
  tests_packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE general_version(
  version varchar(20),
  os varchar(20),
  arch varchar(20),
  program varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch, program)
);
CREATE TABLE percona_backup_mongodb_version(
  version varchar(20),
  os varchar(20),
  arch varchar(20),
  packages varchar(1000),
  constraint pk PRIMARY KEY(version, os, arch)
);
CREATE TABLE ansible_arguments(cmd TEXT, subcmd TEXT, version_filter TEXT, arg_type TEXT CHECK(arg_type IN('VERSION', 'NODE', 'URL','CONST', '')), arg TEXT, arg_default TEXT, orderno int, always_add int);
CREATE TABLE k8s_arguments(
  cmd TEXT,
  subcmd TEXT,
  version_filter TEXT,
  arg_type TEXT,
  arg TEXT,
  arg_default TEXT,
  orderno INT,
  always_add INT
);
CREATE TABLE keyword_aliases(keyword varchar(50), alias varchar(50));
CREATE TABLE subcmd_aliases(keyword TEXT,alias TEXT);
CREATE TABLE help_examples(cmd varchar(100), deploy varchar(1000));
CREATE TABLE download_sites(programs varchar(100), url varchar(512), pattern varchar(100));
CREATE INDEX test_cases_test_id_idx ON test_cases(test_id);
COMMIT;
